import React from "react";
import { NavLink } from "react-router-dom";

const Navbar = () => {
  return (
    <>
    <nav>
    <NavLink to="/">Navbar</NavLink>
    
          <NavLink to="/">Home</NavLink>
      
          <NavLink to="/about">About</NavLink>
      </nav>
    </>
  );
};

export default Navbar;
